script: |
  super -f text -I q4095.spq | sort > q4095.out

inputs:
  - name: q4095.spq
    data: |
      SELECT DISTINCT + col1 * - tab1.col0 + + ( - 33 ) * col2 + ( + col1 * - col1 + 57 ) AS col1 FROM tab1 (FORMAT parquet);
  - name: tab1

outputs:
  - name: q4095.out
    data: |
      -2479
      -2564
      -4320
